(219, 600, '2017-05-30 08:00:00', 'Logan\'s First Day - 45039', 0, 2423, 100, 1254, '2017-05-22 11:20:36', '2017-05-22 11:20:36', 1, -1, 'Logan\'s first day with IDEM.  Supervisor Dora Fields. \r\n\r\nPlease have him come to the Government Center North Building which is located at 100 N Senate Avenue, in an area bounded by West, Ohio, Senate and Washington Streets in downtown Indianapolis as shown on this map:\r\nhttp://www.in.gov/spd/onboarding/images/indy-map-edited.png\r\n \r\nHe can park in an employee parking garage located at either 401 W Washington Street (enter off Missouri Street) or 220 N Senate Avenue (entrances off of both New York and Senate Avenue). He will need to take a ticket at the kiosk which we will validate for him on Tuesday.\r\n \r\nThe government center complex consists of two buildings, a short south building and a tall north building. IDEM Office of Land Quality is located on the 11th floor of the tall north building. The public entrance is located between the buildings. He will have to go through security then turn right and take the east end elevators to the 11th floor. I (Dora) will meet him at the receptionist area on the east end of the 11th floor. Ask the receptionist to call me if I am not there. If he has any trouble, please have him call my cell phone-317-374-5561.\r\n \r\nHe will need $10 to get his contractor\'s badge on the first day.', 300, 0, 'brittanyc@stprofessionals.com', 15, 0),
